import { TransitionGroup } from "react-transition-group";
import Event from "./EventItem";

const EventList = ({remove, create, ...props}) =>
{

    return (
        <div>
            <TransitionGroup>
                {props.events.length !== 0
                ? 
                    props.events.map(event =>
                    <CSSTransition>
                        <Event remove = {remove} event = {event} key = {event.id}/>
                    </CSSTransition>
                    )
                : 
                    <h2 style={{textAlign: 'center'}}>События отсутствуют</h2>
                }
            </TransitionGroup> 
        </div>
    )
}

export default EventList;
